import React, { useState } from "react";
import Register from "./Register";

function Login({ onLogin }) {
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [showRegister, setShowRegister] = useState(false);

  const handleSubmit = async (e) => {
    e.preventDefault();
    const response = await fetch("http://127.0.0.1:8000/api/login/", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ username: email, password }),
    });

    if (response.ok) {
      const data = await response.json();
      localStorage.setItem("token", data.token);
      onLogin();
    } else {
      alert("Credenciales invÃ¡lidas");
    }
  };

  const handleCancel = () => {
    setEmail("");
    setPassword("");
  };

  if (showRegister) {
    return <Register onBack={() => setShowRegister(false)} />;
  }

  return (
    <div className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-600 via-purple-600 to-blue-800 p-4">
      <div className="bg-white p-10 rounded-2xl shadow-2xl w-full max-w-md">
        {/* Header con logo y bienvenida */}
        <div className="text-center mb-8">
          <h1 className="text-4xl font-light text-gray-800 mb-2">Â¡Bienvenido!</h1>
          <p className="text-gray-600 mb-4">Es bueno verte otra vez</p>
          <div className="bg-gradient-to-r from-orange-500 to-orange-600 text-white py-2 px-6 rounded-full inline-block">
            <span className="font-bold text-2xl">florencia</span>
            <span className="font-light ml-2">DRUGSTORE</span>
          </div>
        </div>

        <div className="h-px bg-gradient-to-r from-transparent via-gray-300 to-transparent my-8"></div>

        {/* Formulario */}
        <h2 className="text-3xl font-semibold text-center text-gray-800 mb-8">Iniciar sesiÃ³n</h2>

        <form onSubmit={handleSubmit} className="space-y-6">
          <div>
            <label className="block text-sm font-semibold text-gray-700 mb-2">Usuario</label>
            <input
              type="email"
              placeholder="usuario@email.com"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              className="w-full p-4 border-2 border-gray-200 rounded-xl focus:border-orange-500 focus:outline-none transition-colors"
              required
            />
          </div>

          <div>
            <label className="block text-sm font-semibold text-gray-700 mb-2">ContraseÃ±a</label>
            <input
              type="password"
              placeholder="contraseÃ±a"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              className="w-full p-4 border-2 border-gray-200 rounded-xl focus:border-orange-500 focus:outline-none transition-colors"
              required
            />
          </div>

          <div className="text-right">
            <button type="button" className="text-orange-600 text-sm hover:underline">
              Â¿Olvidaste la contraseÃ±a?
            </button>
          </div>

          <div className="flex gap-4">
            <button
              type="submit"
              className="flex-1 bg-gradient-to-r from-orange-500 to-orange-600 text-white py-4 rounded-xl font-semibold hover:shadow-lg transform hover:-translate-y-1 transition-all duration-200"
            >
              Ingresar
            </button>
            <button
              type="button"
              onClick={handleCancel}
              className="flex-1 bg-gray-400 text-white py-4 rounded-xl font-semibold hover:bg-gray-500 transition-colors"
            >
              Cancelar
            </button>
          </div>
        </form>

        <div className="text-center mt-6">
          <button
            onClick={() => setShowRegister(true)}
            className="text-gray-600 hover:text-orange-600 transition-colors"
          >
            Â¿No tenes una cuenta? <span className="font-semibold">Registrate</span>
          </button>
        </div>
      </div>
    </div>
  );
}

export default Login;
